import React, {Component} from 'react';
import {BrowserRouter} from "react-router-dom";
import Home from './Components/Home';

class App extends Component {

    state= {
        Header:[
            {
                id: 1,
                title: 'BEGELEIDING',
                status: false
            },
            {
                id: 2,
                title: 'PROFESSIONALS',
                status: false
            },
            {
                id: 3,
                title: 'INFORMATIE',
                status:false
            },
            {
                id: 4,
                title: 'CONTACT',
                status:false
            }

        ]
    }

    render() {
        return (
            <BrowserRouter>
                <div className="App">
                    <Home/>
                </div>
            </BrowserRouter>
        );
    }
}

export default App;
